import React, {useState} from 'react';
import menuLogo from "../img/menu.png"

//Создаём Хедер
function Header() {

    return(
        <div className="header">
            <img src={menuLogo}></img>
            <div className="header__logoText">RENE</div>
        </div>
    )
}

export default Header
